import React from 'react';

function DataSourcesPage() {
  return (
    <div>
      <h2>Data Sources</h2>
      <p>Here you can manage and explore different data sources. (No backend connection for now.)</p>
      {/* Example static list */}
      <ul>
        <li>Data Source 1</li>
        <li>Data Source 2</li>
        <li>Data Source 3</li>
      </ul>
    </div>
  );
}

export default DataSourcesPage;
